import React from 'react';
import styled from 'styled-components';

const Title = styled.h1`
  color: #fff;
  margin: 0;
  font-family: 'Do Hyeon';
  font-size: 55px;
  letter-spacing: (15 / 1000) * 1em;
  span {
    color: #06a6ff;
  }
`;

const Header = styled.nav`
  width: 100%;
  background-color: #0c0a26;
  height: 100px;
  display: flex;
  align-items: center;
  padding: 0px 30px;
`;

export default function Index() {
  return (
    <>
      <Header>
        <Title>
          Rotzz.<span>gg</span>
        </Title>
      </Header>
    </>
  );
}
